import Layout from "../Components/Layout";
const About = () => (
  <Layout>
    <div>
      <h1>Welcome to BitPrice </h1>
      <hr/>
      <h3 className="color">ABOUT</h3>

      <p> Application To View Bitcoin Prices from Coindesk API</p>
    </div>
  </Layout>
);

export default About;
